class Perfil extends Component{
    
   
    render(){
        var usuario= sessionStorage.getItem('usuarioActivo');
console.log(usuario.correo)
        return(
            <Fragment>
                <h1>
                    {
                        usuario.correo
                        
                    }    
                </h1>
                
            </Fragment>
        )
    }
}export default Perfil;
